import React from 'react';
import { CssBaseline,AppBar,Toolbar,Typography } from '@mui/material';

const Heeder = () => {
    return (
        <>
            <CssBaseline />
      <AppBar position="relative">
        <Toolbar>
          <CameraIcon sx={{ mr: 2 }} />
          <Typography variant="h6" color="inherit" noWrap>
            Album layout
          </Typography>
        </Toolbar>
      </AppBar>
        </>
    )
}

export default Heeder;
